import { createBrowserRouter } from "react-router-dom";
import Layout from "../layout/Layout";
import Homescreen from "../pages/Homescreen";

const mainRoute = createBrowserRouter(
    [
        {
            element: <Layout />,
            children: [
                {
                    path: "/",
                    element: <Homescreen />
                }
            ]
        }
    ]
)

export default mainRoute
